// src/components/FirmFactCard/FirmFactCard.tsx
import React from 'react';
import './FirmFactCard.scss';
import Button from '../Button/Button';

interface FirmFactCardProps {
  variant: 'default' | 'border';
  buttonText: string;
}

const FirmFactCard: React.FC<FirmFactCardProps> = ({ variant, buttonText }) => {
  return (
    <div className={`firmFactCard ${variant}`}>
      <div className="firmFactCard-content">
        <Button variant="default" text={buttonText} />
      </div>
    </div>
  );
};

export default FirmFactCard;
